import React, {Component} from 'react'
import './assets/css/Sidebar.scss'
import list from "../list"


class Sidebar extends Component {
    render() {
        return (
            <div className="sidebar">
                <div className="container">{list.map((file) => (
                    <div>{file.split("/")}</div>
                ))}</div>
            </div>
        )
    }
}

export default Sidebar
